import { Link } from "react-router-dom";

export const Header = ({ date }) => {
  return (
    <header>
      <div>
        <h1> Hamburger App</h1>
        <Link to="/login"> Login</Link>
        <Link to="/register"> Register</Link>
      </div>
      {date}
    </header>
  );
};
